import axios from "axios";

export default function isUserLoggedIn() {
    let result = false;
    axios.get("http://localhost:5000/api/sessions", { withCredentials: true })
        .then(response=>{
            console.log("sending true");
            if (response.status == "200") { result = true };
        })
        .catch((error) => {
            console.log(error);
        })
    console.log(result)
    return result;
}
